import styled from "styled-components";
import { theme } from "../../../theme/Theme";

import Title from "./Title";
import SubTitle from "./Subtitle";
import Description from "./Description";

const TextSideContainer = styled.div`
  width: 100%;
  height: 100%;

  padding: ${theme.spacing.space.small};

  display: flex;
  flex-direction: column;
`;

export default function TextSide() {
  return (
    <TextSideContainer>
      <Title text={"Project name here"} />
      <SubTitle
        leftText={"created with"}
        rightText={"HTML, CSS, React, TypeScript and Postgres || Express, JWT, Styled Components etc"}
      />
      <SubTitle leftText={"more"} rightText={"Test, test and test"} />
      <SubTitle leftText={"other"} rightText={"Test, test and test"} />
      <Description />
    </TextSideContainer>
  );
}
